import React from 'react'
import { Chart } from "react-google-charts";
import { useState, useEffect } from 'react';

function Piechart({user, tics}) {

    const [ticData, setTicData] = useState([])

    console.log(tics)

  let data = [
      ["Title", "Priority"],
  ]

  tics.forEach(ticket => {
    data.push([ticket.title, ticket.priority])
  });

  const options = {
      title: "Tickets by Priority",
      chartArea:{
        width: '100%',
        height: '400px',
      },
      backgroundColor: {
        fill: '#EFEDE7',
        stroke: '#b0b0b0',
        strokeWidth: 2
      },
  }


useEffect(() => {
    setTicData(data)
   }, [])

console.log(ticData)


  return (
    <div>
        <Chart 
        chartType="PieChart"
        data={ticData}
        options={options}
        />
    </div>
  )
}

export default Piechart
